import React from 'react';
import { Route } from 'react-router-dom';

const LayoutRoute = ({ component: Component, layout: Layout, ...rest }) => (
  <Route
    {...rest}
    render={props => (
      localStorage.getItem('usertoken') ? (
        <Layout>
          <Component {...props} />
        </Layout>
      ) : (
          <Redirect
            to={{
              pathname: "/login"
            }}
          />
        ))}
  />
);


export default LayoutRoute;
